The order of episodes on that DVD is not the order in which they were first broadcast, either in the U.K. or the U.S. The order is the order sanctioned by &quot;The Prisoner Appreciation Society&quot;:
 &lt;a href=&quot;
http://en.wikipedia.org/wiki/List_of_The_Prisoner_episodes&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://en.wikipedia.org/wiki/List_of_The_Prisoner_episodes&lt;/a&gt;

